import React from 'react';

class Navbar extends React.Component{
    render(){
        return <div>
            <a href="/">
                <img src="" alt=""/>
                <span className="font-weight-light">Platzi</span>
                <span className="font-weight-bold">Conf</span>
            </a>
        </div>;
    }
}

export default Navbar;
